INSERT INTO machine_types (idmachinetype, name, description) VALUES (1, 'Tractor o Canguro', 'Vehículo especial autopropulsado que se usa para arrastrar o empujar remolques, embarcaciones, aperos u otra maquinaria o cargas pesadasequeña de carga');
