INSERT INTO fuel_types (idfueltype, name, description) VALUES (1, 'Gasolina', 'La gasolina es una mezcla de hidrocarburos alifáticos obtenida del petróleo por destilación fraccionada, la cual se usa en motores de combustión interna.');
INSERT INTO fuel_types (idfueltype, name, description) VALUES (2, 'Diésel', 'El diésel también conocido como gasóleo o gasoil es un hidrocarburo líquido compuesto fundamentalmente por parafinas y utilizado principalmente en motores diésel.');
INSERT INTO fuel_types (idfueltype, name, description) VALUES (3, 'Etanol', 'El etanol es un compuesto químico obtenido a partir de la fermentación de los azúcares (maíz, cebada o trigo) o bien mezclado en cantidades variadas con gasolina.');
INSERT INTO fuel_types (idfueltype, name, description) VALUES (4, 'Gas Natural', 'El GLP, también conocido como gas licuado de petróleo, es una mezcla de gases livianos licuados presentes en el gas natural o disueltos en el petróleo, conformados principalmente por propano y butano. El GLP puede utilizarse en motores de combustión');
